  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0145945 includes physical
  and profile data collected aboard the Sikuliaq during cruise SKQ201503T in the Gulf
  of Alaska from 2015-02-19 to 2015-03-12. These data include CONDUCTIVITY, SALINITY
  and WATER TEMPERATURE. The instruments used to collect these data include CTD. These
  data were collected by Steven Hartz of University of Alaska - Fairbanks as part
  of Sikuliaq Homecoming. The Lamont-Doherty Earth Observatory (LDEO) submitted these
  data to NCEI as part of the NSF sponsored Rolling Deck to Repository (R2R) program.\",\n\t\"owner_org\":
